import React, { Component } from 'react';
import './prog.css';
class Prog extends Component {
    
    render() { 
        return ( <div class="container">

        
      
        <div class="progress">
      
          <div class="progress-bar">
      
            <div class="progress-shadow"></div>
      
          </div>
          </div>
          
      
      
</div>
      
      
       );
    }
}
 
export default Prog;
